package com.example.oppgave3;

import javafx.application.Application;
import javafx.geometry.Pos;
import javafx.scene.Scene;
import javafx.scene.image.ImageView;
import javafx.scene.layout.GridPane;
import javafx.stage.Stage;

import java.io.IOException;
import javafx.scene.image.Image;

public class Bilder extends Application {
    @Override
    public void start(Stage stage) throws IOException {
        //Oppretter et grid-objekt
        GridPane panel = new GridPane();
        //setter mellomrom og padding
        panel.setAlignment(Pos.CENTER);
        panel.setHgap(5);
        panel.setVgap(5);

        //oppretter image og legger til imageview
        Image image = new Image("data:image/jpeg;base64,");
        //legger bilde til panel ved hjelp av imageview
        panel.add(new ImageView(image), 0, 0);
        panel.add(new ImageView(image), 1, 0);
        panel.add(new ImageView(image), 0, 1);
        panel.add(new ImageView(image), 1, 1);

        //legger panel til scene
        Scene scene = new Scene(panel);
        //legger scene til stage.
        stage.setTitle("Fire bilder");
        stage.setScene(scene);
        stage.show();;
    }

    public static void main(String[] args) {
        launch();
    }
}